Xmax = 200;

axesPosition = [60 60 600 200];  %# Axes position, in pixels
xLimit = [0 Xmax];         %# Range of x values

%# Create the figure and axes:
figure('Units','pixels','Position',[200 200 730 300]);

axes1 = axes('Units','pixels','FontSize',16,'Position',axesPosition,...
          'Color','w','XColor','k','YColor','k',...
          'XLim',xLimit,'YLim',[17 21],'NextPlot','add');
axes2 = axes('Units','pixels','FontSize',16,'YAxisLocation','right','Position',axesPosition,...
          'Color','none','XColor','k','YColor','k',...
          'XLim',xLimit,'YLim',[0 3],...
          'XTick',[],'XTickLabel',[],'NextPlot','add');
      
xlabel(axes1, 'Time');
ylabel(axes1, 'Celsius');
ylabel(axes2, 'Setting');
hold(axes1, 'all');
hold(axes2, 'all');
title(axes1,[])
title(axes2,[])

% prepare values for plotting
y2_n = y2/4; % v1
y3_n = y3/4; % w1
x4_n = x4(y4~=0); % temp1
y4_n = y4(y4~=0);
y4_td = (20 - y4_n).^2; % td1
y5_n = y5; % tempdev1
y6_n = y6; % valve1
y7_n = y7; % window1
x8_n = x8(y8~=0); % temp2
y8_n = y8(y8~=0);
y8_td = (20 - y8_n).^2; % td2
y9_n = y9; % tempdev2

% averages
z3 = sum(y3_n)/size(y3_n,2);
z2 = sum(y2_n)/size(y2_n,2);
z4 = sum(y4_n)/size(y4_n,2);
z4_td = sum(y4_td)/size(y4_td,2);
z5 = sum(y5_n)/size(y5_n,2);
z6 = sum(y6_n)/size(y6_n,2);
z8_td = sum(y8_td)/size(y8_td,2);

% plot
plot4 = plot(x4_n, y4_n, 'x-b', 'Parent', axes1, 'LineWidth', 2); % temp1
plot([0,1000],[z4,z4],'--b', 'Parent', axes1, 'LineWidth', 1); % average temp1
td2 = plot(x8_n, y8_td, 'x-g', 'Parent', axes2, 'LineWidth', 2); % tempdev2 - recalculated
plot([0,1000],[z8_td,z8_td],'--g', 'Parent', axes2, 'LineWidth', 1); % average tempdev2
plot3 = plot(x3, y3_n, '^-c', 'Parent', axes2, 'LineWidth', 2); % w1
