td1 = plot(x4_n, y4_td, 'o-k', 'Parent', axes2, 'LineWidth', 2); % tempdev1 - recalculated
plot([0,1000],[z4_td,z4_td],'--k', 'Parent', axes2, 'LineWidth', 1); % average tempdev1

